import React from 'react';
import Main from './Luzoid_task/Main';
import Signup from './Luzoid_task/Signup';
import Login from './Luzoid_task/Login';
import {BrowserRouter as Router,Routes,Route} from "react-router-dom";

function App() {
  return (
  <>
<Router>
<Main/>
<React.Fragment>
	<Routes>
	<Route  path="/signup">
	 <Signup />
	</Route>
	<Route path="/login">
		<Login/>
	 </Route>
	 </Routes>
</React.Fragment>
 </Router>

  </>
  );
}

export default App;
